function History() {


    return (
      <>
        <form>
        <label for="date">From:</label>
        <input type="date" id="date" name="from"/>
        <label for="date">To:</label>
        <input type="date" id="date" name="to"/>
        </form>
      </>
    );
  }

  export default History;
